const App=()=>{
    const [num1,setnum1]=useState(0)
    useEffect(()=>{
        useEffect(()=>{
            alert("Hello");
        }) 
        alert("you have Clicked");
    })  
   return(<>
        <button onClick={()=>{
            setnum1(num1+1);
        }} style={{height:"40px",width:"90px"}}>Click Me {num1}</button>
    </>);
}
export default App;
